function QuoteRow(props)
{
    return <tr>
                    <td width>
                        {props.quote.id}
                    </td>
                    <td>
                        {props.quote.quote}
                    </td>
                    <td>
                        {props.quote.author}
                    </td>
           </tr>
}
export default QuoteRow;
